function add_ad(enableTracking,source,target,type){
	try {
		type = (type) ? type : 'secondtier';

		targetWindow = (adsTargetNew[type]) ? '_blank' : targetWindow;
		source.n = adIndex;
		adIndex++;
		source.visible_url = source.displayurl;
		var p_wrap = document.createElement('p');
		p_wrap.setAttribute('id','ad-'+type+'-'+adIndex);
		p_wrap.setAttribute('class','ad');

		var pid = (source.pid) ? '&pid='+source.pid : '';

		epl = source.epl;



		p_wrap.appendChild(createGoogleAdLink(enableTracking, 'span', 'adtitle', source.title, buildAdRedirectUrl('click?epl='+epl+pid, 0, source, source.clickurl), 'nofollow', targetWindow, '', source.clickurl));
		p_wrap.appendChild(createGoogleAdLine('span', 'addesc', source.description));
		p_wrap.appendChild(createGoogleAdLink(enableTracking, 'span', 'adurl', source.displayurl, buildAdRedirectUrl('click?epl='+epl+pid, 0, source, source.clickurl), 'nofollow', targetWindow, '', source.clickurl));
		target.appendChild(p_wrap);

		return adIndex;
	}
	catch(e) {
		console.log(e)
	}
}

