function process_ads(response){



	var tracking = LANDER.Ads.trackingConfig;
	var secondtierAds = response.regular;

	if(secondtierAds) {
		numberAdsReturned = secondtierAds.length;
			var hasTracking = (tracking.enableSecondTier) ? true : false;
			var target = document.getElementById('secondtier_ads_block');
			var target_ads = target.getElementsByTagName('div')[0];


			if(numberAdsReturned){
				for(var i=0; i < numberAdsReturned; i++){
					add_ad(hasTracking,secondtierAds[i],target_ads,'secondtier','_blank');
				}
				if(response.premium) {
					target_ads.innerHTML = '
Additional Listings' + target_ads.innerHTML;
				}
				target.style.display='';	
		}


	}

	var premiumAds = response.premium;
	if(premiumAds) {
		numberAdsReturned = premiumAds.length;
		var hasTracking = (tracking.enableYahoo) ? true : false;
		var target = document.getElementById('yahoo-ads-target');

		if(numberAdsReturned){




			for(var i=0; i < numberAdsReturned; i++){
				 add_ad(hasTracking,premiumAds[i],target,'yahoo');
			}

			// Yahoo ads were written, display accordingly
			document.getElementById('yahoo-ads').style.display=''; // Open up the ads block
		}

	}

	if(!t_set){ 


		var click_token =(response && response.token) ? response.token : '';
		var hasTracking = (tracking.enableSecondTier) ? true : false;
		var search_token =(response && response.search_token) ? response.search_token: '';
		var search_token =(response && response.search_token) ? response.search_token: '';

		if(numberAdsReturned && click_token && search_token){
			addToken(click_token, search_token);
		} else if(calledAFD && click_token && search_token){
			addToken(click_token, search_token);
		}

	}


	 callPixels();




	return false;
}







function renderAds(source, target, redirectUrl, numberWrittenBefore, numberReturned){
	var hasTracking = (LANDER.Ads.trackingConfig.enableGoogle) ? true : false;
	var numberWritten = 0;

		if(target == null) {
			return numberWritten;
		}
		var targetDiv = target;

		if(source != undefined && source != null) {
			var currentIndex = numberWritten + numberWrittenBefore;

			adObj = new Object();
			adObj.index = currentIndex + 1;
			adObj.target = targetDiv.id;
			adObj.type = googleAdType;

			var ad_elt = createGoogleAdElement(hasTracking, buildAdRedirectUrl(redirectUrl, currentIndex,	source), source, source.type, adObj);

			renderAdext(ad_elt, source, redirectUrl, currentIndex);
			targetDiv.appendChild(ad_elt);
			numberWritten++;
		}
		if(document.getElementById("google")) {
			document.getElementById("google").style.display = "";
		}
		return numberWritten;

}




function logLink(e,link,isTracking) {
	var e = e || window.event;
	var url = link.href; 

	if(typeof e.preventDefault == 'function') {
		e.preventDefault()
	}
	else {
		e.returnValue = false;
	}	

	if(isTracking) {
		var redirect = link.getAttribute('data-redirect');

		if(Scatter) {
			Scatter.get(redirect); 
		}
	}
	window.open(url)
	return true;
}


function convertHeading2Url(url, tElm, nWin){
    var elm = document.getElementById(tElm);
    var hElm = elm.getElementsByTagName('h2');
    var nElm = document.createElement("A");


    if(hElm[0].firstChild.nodeName == 'IMG'){
        var nElmInner = document.createElement('IMG');
        nElmInner.setAttribute("src", hElm[0].firstChild.src);
    } else {
        var nElmInner = document.createTextNode(hElm[0].innerHTML);
    }

    nElm.setAttribute('href', url); 
    nElm.setAttribute('class', 'ads_group_title'); 
    if(nWin) nElm.setAttribute('target', '_blank'); 
    nElm.appendChild(nElmInner);
    hElm[0].removeChild(hElm[0].firstChild);
    hElm[0].appendChild(nElm);
}

function buildAdRedirectUrl(redirectUrl, currentIndex, currentGoogleAd, go_url){

    var v_url = currentGoogleAd.visible_url;
    v_url = v_url.replace(/<(.*?)>/g,'');
    v_url = v_url.replace(/<(.*?)>/g,'');

    return redirectUrl + 
        '&rank=' + currentGoogleAd.n +
        '&click_display_url=' + escape(v_url) +
        '&go_url=' + encodeURIComponent(go_url || currentGoogleAd.url);
}


function createGoogleAdElement(enableTracking, url, googleAd, adFormat, ad){
	var p_wrap = document.createElement('p');

	if(ad) {
		p_wrap.setAttribute('id','ad-'+ad.target+'-'+ad.type+'-'+ad.index);
	}

 p_wrap.appendChild(createGoogleAdLink(enableTracking, 'span', 'adtitle', googleAd.line1, url, 'nofollow', targetWindow, '', googleAd.url));



// Convert to wide ads
var line = '';
if (googleAd.line2) {
	line += ' ' + googleAd.line2;
}
if (googleAd.line3) {
	line += ' ' + googleAd.line3;
}
p_wrap.appendChild(createGoogleAdLine('span', 'addesc', line));



 p_wrap.appendChild(createGoogleAdLink(enableTracking, 'span', 'adurl', googleAd.visible_url, url, 'nofollow', targetWindow, '', googleAd.url));

    return p_wrap;
}

 function renderAdext(p_wrap, googleAd, redirectUrl, currentIndex){

    if(!(googleAd.sitelinks || googleAd.seller_ratings)){
        return;
    }

    var adext_wrap = eltWithClass('span', 'adext');

    if(googleAd.seller_ratings){
        adext_wrap.appendChild(createAdextRating(googleAd.seller_ratings));
    }

    if(googleAd.sitelinks){
        var sitelinks_wrap = eltWithClass('span', 'adext_slinks');

        var left_col  = eltWithClass('span', 'adext_slinks_col');
        var right_col = eltWithClass('span', 'adext_slinks_col');
	for(var i = 0; i < googleAd.sitelinks.length; i++){
            var sl = createSitelinkElt(googleAd, redirectUrl, i, currentIndex);            
            if(i % 2){
                right_col.appendChild(sl); 	
     	    } else {
                left_col.appendChild(sl);
            }
        }

        sitelinks_wrap.appendChild(left_col);
        sitelinks_wrap.appendChild(right_col);
	sitelinks_wrap.appendChild(eltWithClass('span', 'adext_slinks_sep'));

        adext_wrap.appendChild(sitelinks_wrap);
    }

    p_wrap.appendChild(adext_wrap);
}

function createSitelinkElt(googleAd, redirectUrl, index, currentIndex){
    var sl = googleAd.sitelinks[index];
   	var tracking = LANDER.Ads.trackingConfig,
	hasTracking = (tracking.enableGoogle) ? true : false;

    return createGoogleAdLink(hasTracking, 'span', 'adext_addesc',  sl.link_text, 
                               buildAdRedirectUrl(redirectUrl,currentIndex, googleAd, sl.url),
                               'nofollow', targetWindow, '',
                               sl.url, 'text-decoration: none;');
}



function createAdextRating(r){
    var rate_wrap = eltWithClass('span', 'adext_rating');
   	var tracking = LANDER.Ads.trackingConfig,
	hasTracking = (tracking.secondTier) ? true : false;


		if(r.text) {
			var adextRating = r.text;
			var stars = '';
			adextRating = adextRating.replace('{{RATING}}',stars);
			var link_start = '';
			var link_end = '';
			adextRating = adextRating.replace('{{LINK_START}}',link_start);
			adextRating = adextRating.replace('{{LINK_END}}',link_end);
			rate_wrap.appendChild(createGoogleAdLine('span', 'adext_addesc', adextRating));
		}


    return rate_wrap;
}

function eltWithClass(tag, cl){
    var elt = document.createElement(tag);
    elt.className = cl;
    return elt;	
}


function createGoogleAdLink(hasTracking, tagName, className, text, url, rel, target, onclick, name, styling){
	try {
		if(text.match(/<(.*?)>/g)){ 
		  text = text.replace(/<(.*?)>/g,'<$1>');
		}

		var link_wrap 		= document.createElement(tagName);  
		var link 			= document.createElement('a');



		if(hasTracking) {
			link.setAttribute('data-redirect',url + '&nored=1');
			url = name;
		}

		link_wrap.className	= className;  
		link.href 			= url;
		link.rel 			= rel ? rel : '';
		link.className 		= className + "_link";
		link.name			= name ? name : '';
		link.innerHTML		= text;
		link.style.cssText	= styling ? styling : '';
		link.onclick = function(event) {
			if(hasTracking) {
				logLink(event,this,true)
			}
			else {
				logLink(event,this,false)
			}
		}
		link_wrap.appendChild(link);
		return link_wrap;
	}
	catch(e) {
	}
}

function createGoogleAdLine(tagName, className, innerHTML){
    var line = document.createElement(tagName);  
    line.className = className;
    line.innerHTML = innerHTML;
    return line;
}

function getParam(name){
	var match = new RegExp(name + "=([^&]+)","i").exec(location.search);
	if(match==null)
		match = new RegExp(name + "=(.+)","i").exec(location.search);
	if(match==null)
		return null;
	match = match + "";
	result = match.split(",");
	return result[1];
}


(function(){
    var DomReady = window.DomReady = {};

    var userAgent = navigator.userAgent.toLowerCase();

    browser = {
    	version:(userAgent.match(/.+(?:rv|it|ra|ie)[\/: ]([\d.]+)/) || [])[1],
    	safari: /webkit/.test(userAgent),
    	opera: /opera/.test(userAgent),
    	msie:(/msie/.test(userAgent)) &&(!/opera/.test(userAgent)),
    	mozilla:(/mozilla/.test(userAgent)) &&(!/(compatible|webkit)/.test(userAgent))
    };    

	var readyBound = false;	
	var isReady = false;
	var readyList = [];


	function domReady(){

		if(!isReady){

			isReady = true;

	        if(readyList){
	            for(var fn = 0; fn < readyList.length; fn++){
	                readyList[fn].call(window, []);
	            }
	            readyList = [];
	        }
		}
	};


	function addLoadEvent(func){
	  var oldonload = window.onload;
	  if(typeof window.onload != 'function'){
	    window.onload = func;
	  } else {
	    window.onload = function(){
	      if(oldonload){
	        oldonload();
	      }
	      func();
	    }
	  }
	};

	 function bindReady(){
		if(readyBound){
		    return;
	    }

		readyBound = true;


		if(document.addEventListener && !browser.opera){

			document.addEventListener("DOMContentLoaded", domReady, false);
		}

		 if(browser.msie && window == top)(function(){
			if(isReady) return;
			try {


				document.documentElement.doScroll("left");
			} catch(error){
				setTimeout(arguments.callee, 0);
				return;
			}

		    domReady();
		})();

		if(browser.opera){
			document.addEventListener("DOMContentLoaded", function(){
				if(isReady) return;
				for(var i = 0; i < document.styleSheets.length; i++)
					if(document.styleSheets[i].disabled){
						setTimeout(arguments.callee, 0);
						return;
					}

	            domReady();
			}, false);
		}

		if(browser.safari){
		    var numStyles;
			(function(){
				if(isReady) return;
				if(document.readyState != "loaded" && document.readyState != "complete"){
					setTimeout(arguments.callee, 0);
					return;
				}
				if(numStyles === undefined){
	                var links = document.getElementsByTagName("link");
	                for(var i=0; i < links.length; i++){
	                	if(links[i].getAttribute('rel') == 'stylesheet'){
	                	    numStyles++;
	                	}
	                }
	                var styles = document.getElementsByTagName("style");
	                numStyles += styles.length;
				}
				if(document.styleSheets.length != numStyles){
					setTimeout(arguments.callee, 0);
					return;
				}

				domReady();
			})();
		}

	  addLoadEvent(domReady);
	};


	DomReady.ready = function(fn, args){

		bindReady();


		if(isReady){

			fn.call(window, []);
	    } else {

	        readyList.push(function(){ return fn.call(window, []); });
	    }
	};

	bindReady();
})();

function countTopAds(ads) {
	if(!ads) {
		return 0;
	}
	var totalAdsReturned = (ads.length >= 0) ? ads.length : 0;
	var numberTopAds = 0;
	for(var i=0; i < totalAdsReturned; i++) {
		if(ads[i].position == 'Top') {
			numberTopAds++;
		}
	}
	numberTopAds = (numberTopAds == 0) ? totalAdsReturned : numberTopAds; // If there are no 'Top' ads, then that means there were no repeatin ads requested


	return numberTopAds;
}

