	if(response.ads){ 
		var google_ads = response.ads;
	} else {
		var google_ads = response;
	}

	var numberAdsReturned = countTopAds(google_ads);
	googleAdsCalled = numberAdsReturned;


 	if(numberAdsReturned < totalNeededAds) {








